import React from 'react';
import {AppBar, Toolbar, Typography} from '@material-ui/core';

class Header extends React.Component {
    render() {
        return (
            <AppBar position="static">
                <Toolbar>
                    <Typography variant="subtitle1" gutterBottom>
                        Exercises data base
                    </Typography>
                </Toolbar>
            </AppBar>
        )
    }
}

export default Header;
